(6, 'projects', 'Projects', '[title]Projects[/title]\r\n\r\n[title2]Upgoing Projects[/title2]\r\n[hr][/hr]\r\n[b][i][color=teal]Thank Meter[/color][/i][/b]\r\n[i]Features:[/i]\r\n- IP & Cookies are saved, to prevent 1000 thanks; it''s fair\r\n- Custom Background/Design (Page/Thank Meter Signature)\r\n- Player Online/Offline Displayed at Thank Meter Signature\r\n- Comment System\r\n- Special Event Theme (Your Thank Meter Page will be automatic themed depends on the event)\r\n- Thank Meter Image Ranks (In Thank Meter Page)\r\n\r\nRequest at [url=https://cit2.net/index.php?topic=162161.0]Click Me[/url].\r\n\r\n\r\n\r\n[title2]Multi Theft Auto Resources[/title2]\r\n[hr][/hr]\r\n[b][i][color=teal]Staff Tools (gostaff)[/color][/i][/b]\r\nThis script creates a staff team and when you type /staff you get admin skin and you don''t die and you go to staff team.\r\nPlease Comment if you have find a bug. Have Fun!\r\n\r\nOnly Admins, SuperModerator, Moderator, Mapper only can used it.\r\n\r\nInvincible!!\r\n\r\nAAYUSH, IDriver and rock_roll sux! -Curt\r\nPlease Vote as 5/5. Thanks for downloading.\r\n\r\nLinks: [url=http://community.multitheftauto.com/index.php?p=resources&s=details&id=4810]Download[/url]\r\n\r\n\r\n[b][i][color=teal]restart your server (tkserver)[/color][/i][/b]\r\nHey guys, I made kick all players when you type /tkserver update \r\n\r\nIt just a simple functions..\r\nWhy I upload this resource? Because it''s useful to save player''s data rather instant shutdown/exit of the server.\r\n\r\nHow to:\r\n1. Do /tkserver update\r\n2. The countdown will start, 20 to 1\r\n3. If it''s countdown is 1 then players will get kicked (with reason), all resource will stop and the server will just shutdown.\r\n4. Start your server again (Do manually) And the player''s data will not lost!\r\n\r\nNOTE: Must have admin access in acl\r\nLinks: [url=http://community.multitheftauto.com/index.php?p=resources&s=details&id=4810]Download[/url]\r\n\r\n\r\n[b][i][color=teal]Youtube Sound Player (youtubemp3)[/color][/i][/b]\r\nSpecial Thanks to Pilovali for the api\r\n\r\nHow-to:\r\n1. Get a youtube video link, for an example https://www.youtube.com/watch?v=nhjGKgI0ZGw\r\n2. Go to your server and start the resource called youtubemp3\r\n3. If you want gui do this command /youtubemp3 or you if you want F8, just do this command "youtubeplay [linkvideo]" (without ")\r\n4. GUI- Paste the Link in the editbox then click play/stop! Just wait it to play.\r\n\r\nNotice: Some videos will be slow to play because of the api traffic!\r\n\r\nScreenshots:\r\nhttps://dl.dropboxusercontent.com/u/106653210/Images%20-%2..-12-07.png\r\n\r\nhttps://dl.dropboxusercontent.com/u/106653210/Images%20-%2..-12-48.png\r\nLinks: [url=http://community.multitheftauto.com/index.php?p=resources&s=details&id=10065]Download[/url]'),
