(16, 'privacypolicy', 'Privacy Policy', '[title2]Privacy Policy[/title2]\r\nThis privacy policy has been compiled to better serve those who are concerned with how their ''Personally identifiable information'' (PII) is being used online. PII, as used in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.\r\n\r\nWhat personal information do we collect from the people that visit our blog, website or app?\r\n\r\nWhen ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, mailing address, phone number, Paypal or other details to help you with your experience.\r\n\r\nWhen do we collect information?\r\n\r\nWe collect information from you when you register on our site, place an order or enter information on our site.\r\n\r\n\r\nHow do we use your information?\r\n\r\nWe may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways:\r\n\r\n      â€¢ To improve our website in order to better serve you.\r\n      â€¢ To allow us to better service you in responding to your customer service requests.\r\n      â€¢ To administer a contest, promotion, survey or other site feature.\r\n      â€¢ To quickly process your transactions.\r\n\r\nHow do we protect visitor information?\r\n\r\nOur website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.\r\n\r\nWe use regular Malware Scanning.\r\n\r\nYour personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information you supply is encrypted via Secure Socket Layer (SSL) technology.\r\n\r\nWe implement a variety of security measures when a user places an order to maintain the safety of your personal information.\r\n\r\nAll transactions are processed through a gateway provider and are not stored or processed on our servers.\r\n\r\nDo we use ''cookies''?\r\n\r\nYes. Cookies are small files that a site or its service provider transfers to your computer''s hard drive through your Web browser (if you allow) that enables the site''s or service provider''s systems to recognize your browser and capture and remember certain information. For instance, we use cookies to help us remember and process the items in your shopping cart. They are also used to help us understand your preferences based on previous or current site activity, which enables us to provide you with improved services. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.\r\n\r\nWe use cookies to:\r\n      â€¢ Help remember and process the items in the shopping cart.\r\n      â€¢ Understand and save user''s preferences for future visits.\r\n      â€¢ Compile aggregate data about site traffic and site interactions in order to offer better site experiences and tools in the future. We may also use trusted third party services that track this information on our behalf.\r\n\r\nYou can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer) settings. Each browser is a little different, so look at your browser''s Help menu to learn the correct way to modify your cookies.\r\n\r\nIf you disable cookies off, some features will be disabled It won''t affect the users experience that make your site experience more efficient and some of our services will not function properly.\r\n\r\nHowever, you can still place orders .\r\n\r\n\r\nThird Party Disclosure\r\n\r\nWe do not sell, trade, or otherwise transfer to outside parties your personally identifiable information unless we provide you with advance notice. This does not include website hosting partners and other parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others'' rights, property, or safety. \r\n\r\nHowever, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.\r\n\r\nThird party links\r\n\r\nWe do not include or offer third party products or services on our website.\r\n\r\nGoogle\r\n\r\nGoogle''s advertising requirements can be summed up by Google''s Advertising Principles. They are put in place to provide a positive experience for users. https://support.google.com/adwordspolicy/answer/1316548?hl=en \r\n\r\nWe have not enabled Google AdSense on our site but we may do so in the future.\r\n\r\nCalifornia Online Privacy Protection Act\r\n\r\nCalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law''s reach stretches well beyond California to require a person or company in the United States (and conceivably the world) that operates websites collecting personally identifiable information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals with whom it is being shared, and to comply with this policy. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf\r\n\r\nAccording to CalOPPA we agree to the following:\r\nUsers can visit our site anonymously\r\nOnce this privacy policy is created, we will add a link to it on our home page, or as a minimum on the first significant page after entering our website.\r\nOur Privacy Policy link includes the word ''Privacy'', and can be easily be found on the page specified above.\r\n\r\nUsers will be notified of any privacy policy changes:\r\n      â€¢ On our Privacy Policy Page\r\nUsers are able to change their personal information:\r\n      â€¢ By emailing us\r\n      â€¢ By logging in to their account\r\n      â€¢ By chatting with us or sending us a ticket\r\n\r\nHow does our site handle do not track signals?\r\nWe honor do not track signals and do not track, plant cookies, or use advertising when a Do Not Track (DNT) browser mechanism is in place.\r\n\r\nDoes our site allow third party behavioral tracking?\r\nIt''s also important to note that we allow third party behavioral tracking\r\n\r\nCOPPA (Children Online Privacy Protection Act)\r\n\r\nWhen it comes to the collection of personal information from children under 13, the Children''s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, the nation''s consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children''s privacy and safety online.\r\n\r\nWe do not specifically market to children under 13.\r\n\r\nFair Information Practices\r\n\r\nThe Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.\r\n\r\nIn order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur:\r\nWe will notify the users via email\r\n      â€¢ Within 1business days\r\nWe will notify the users via in site notification\r\n      â€¢ Within 1 business days\r\n\r\nWe also agree to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users, but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors.\r\n\r\nCAN SPAM Act\r\n\r\nThe CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.\r\n\r\nWe collect your email address in order to:\r\n\r\nTo be in accordance with CANSPAM we agree to the following:\r\n\r\nIf at any time you would like to unsubscribe from receiving future emails, you can email us at\r\nand we will promptly remove you from ALL correspondence.'),
(17, 'tos', 'Terms of Service', '[title2]Terms of Service[/title2]\r\n\r\nPlease read the following terms of Curt Creation service carefully, as they set out our and your legal rights and obligations in relation to our game hosting services.\r\nViolation of any of the below Terms of Service will result in suspension or termination of your account by Curt Creation Staff Team with notice.\r\n\r\n- Refund and Disputes\r\nServers are eligible for refunds within 7 twenty-four hour days of the creation of the server in our database. This point is not marked by the time at which your initial payment is processed and may differ by several hours or days. Refunds cannot be requested without probable cause. As dedicated servers require explicit provisioning, we are not able to provide refunds on these orders.\r\nAny service purchased with a promotional code that gives you an additional product or service is not eligible for refund.\r\n\r\n- Cancellations\r\nTo terminate your service you must email the owner at curt@curtcreation.net.\r\n\r\n- Liability Limitation and Exculsion \r\nCurt Creation, under no circumstances, shall be held liable for any data loss, disruption of information, or distribution of information including but not limited to that of unauthorized access to our server systems or any other loss of data. Curt Creation shall not be held liable for any disruption, delay, or disconnection of services for any period of time. \r\nCurt Creation is not responsible for any actions taken place in or on our game servers themselves. The sole role of Curt Creation is to provide server connectivity.\r\n\r\n- Support \r\nAny support requests required for services from Curt Creation shall be submitted through the game control panel via tickets or email at curt@curtcreation.net. Any other form of contact other than the predetermined ticket system is not guaranteed a proper answer from an official representative.\r\n\r\n- MySQL\r\nWhile we offer instant database creation from our game control panel, you need to understand that our databases are provided as a free service. Because of this we do not hold any liability for MySQL data loss or corruption. By using a database provided by Curt Creation, you understand that we reserve the sole right to terminate it if we deem it necessary. Additionally, our MySQL service is not to be used for personal use, this is not limited to but includes the usage of MySQL for private websites, and other non-server uses.\r\n\r\n- Unfair usage\r\nIf we find your server using any sort of system to bypass limits put on your server (such as slots) your server is subject to being terminated without refund.\r\n\r\n- Termination\r\nAdditionally, we reserve all rights to terminate your server or service upon any violation of these terms, or any other basis if deemed needed.\r\n\r\n- Illegal Use\r\nCurt Creation services may not be used for illegal purposes or support of illegal activies & reserves the right to cooperate with legal authorites and/or injured 3rd parties in the investigation of any suspected crime or civil wrong doing.\r\n\r\n- Resources\r\nCurt Creation services may not be used for any leaked/nulled resources from your server/service.'),
