(15, 'sheamus25', '06/19/2016 05:19:13 pm', 'QgklPugce', '{"realname":"Andhika Surya Rahardja","dob":"2001-12-02","country":"ID","igname":"!Dhikaa[MP]","accountname":"sheamus25","mtaserial":"A79B0752E77CA8A88822FB96F521DCA2","beforemember":"n","beforegroups":"MI6","explain_leave":"I left the MI6 because there are inactive only sheriff[MI6] is online and its bored me and I sayed him im leaving sir and I left, And I Am Not Happy In MI6","stats_ss":"http:\\/\\/imgur.com\\/HfwbG6J","history_ss":"http:\\/\\/imgur.com\\/OcjED1r","explain_accept_tf":"Along this inactivity months I saw some groups grow up and being more active. Then I saw TF an awesome CIT Force group, and I am really interested to be part of this huge team, because some DT members told me a few things about this group like teamwork, trainings, good members and helpful members, so I thought about what he told me about the group and I decided to restart my life in this group.","about_citlife":"I joined the game at 2014 but I went inactive for a year , I started as a cop focusing on killing crimes , getting money and buying new guns. After I got bored from cops I joined criminal side played much but I was still a big noob and a big hopper to be honest so I decided to be a civilian for a while my total playtime when I started being a civilian was 300 Hours I came back to Criminal side , I saw the group SaM and I wanted to join so I joined I stayed loyal for over 1 year then I\\u00a0 decided to leave as I had a bit of problems with some leaders. I applied for TR and got denied so I joined Luxury Gamming it was nice to stay there but I really got bored and CF wasn''t my choice,\\u00a0 finally I joined SWAT Team I loved SWAT Team alot I wasnt planing to leave it but I was shocked how inactive it was and how I couldn''t complete any of my\\u00a0 duties to be promoted.\\u00a0 due to inactivity so I decided to leave.","friendstaskforce":"DerekSZ","ag1":"n","ag2":"y","ag3":"y","ag4":"y","ag5":"n"}'),
(16, 'zoco01', '06/30/2016 01:11:48 pm', 'Xv8e3BicZ', '{"realname":"Nikola","dob":"2001-03-14","country":"RS","igname":"Smeker","accountname":"zoco01","mtaserial":" D4EDG10A3312D1EF53B374F69BFA7685","beforemember":"n","beforegroups":"Global_Army,Marines","explain_leave":"Global_Army- Was 1st rank 7 days.\\r\\nMarines-My friend wanted help about group. And my work about Marines is done.","stats_ss":"http:\\/\\/imgur.com\\/uYOtD6M","history_ss":"http:\\/\\/imgur.com\\/nrdetpt","explain_accept_tf":"I know that I have only 30 hours but this isn''t my first time on server. I am friendly, and also I am loyal. If someone need help I will always help him. Example \\"I helped my friend about group(Marines)\\".  I am good in combating and driving. Also I am good at flying. I was so bad in flying but I trained every day and now I am good at flying. I am persistent and I work hard to get all my goals. So that I will work hard to make a good impression on TaskForce members.","about_citlife":"At the beginning I was civilian to earn some money to start law life because on my old profile I was cop. As a cop I went on Criminal events and shop robberies. I was alone and I decided to join any group. I joined Global Army. They said that I must be 2 days in group to do test. I was 7 days in group and I did not a test. Then I left Global Army. My friend needed help about group and I joined his group to help him. Then I left Marines and now I want to join any good and active group like Task Force.","friendstaskforce":"No, but Rands help me always if i need help.","ag1":"n","ag2":"y","ag3":"y","ag4":"y","ag5":"n"}'),
(17, 'Bobmarley', '07/03/2016 09:41:24 pm', 'juQCy0Aif', '{"realname":"Sel\\u00e7uk","dob":"1997-05-02","country":"TR","igname":"Esconda","accountname":"Bobmarley","mtaserial":"5C1F93EC761651DB35A7F02761A96053","beforemember":"y","beforegroups":"TaskForce | FBI | SAPD | HoBoS | TeamGenesis | Pirus | HispanicGamers | Outrage |","explain_leave":"TaskForce >  My friend called me to come my group I can''t broke hims hearth I left like stupid | FBI > Have bad leaders | SAPD > I''m returned criminal life | HoBoS > Inactive group | TeamGenesis > Inactive group | Pirus > I don''t like this group | HispanicGamers > Have GMT problem | I''m returned law life.","stats_ss":"http:\\/\\/imgur.com\\/ZUNdWl1","history_ss":"http:\\/\\/imgur.com\\/hPChW1N","explain_accept_tf":"I already was a TaskForce soldier before, I know every rules and I have great relationship with some members in TaskForce. I can improve more my skills if I get accepted in TaskForce. I''m loyal and mature guy who likes to help who needs my help and with that, I believe that I can contribute for the group. You should accept me because I will follow every single rules on the group and I''m helpful.","about_citlife":"I started my CIT life long time ago, I started as random noob who breaks the rules. I was playing just for some fun, I didn''t even read server rules until I started to know step by step the rules and I learned from the mistakes I made. I started to play as cop and it was so boring, but good for money, I switch sometimes from cop to criminal but I was noob criminal. After some days, I made goals in CIT. I''m done with some of them, still many to go. I joined many newbie groups and got some taken\\/defended turfs. I spend time killing some crack groups and have fun. I enjoy playing with my friend Pitbull, I had many great times with my friends in the server, but now my brother stopped playing MTA and I''m remaining with some friends here..","friendstaskforce":"-","ag1":"n","ag2":"y","ag3":"y","ag4":"y"